module ActionsHandler {
    export const openAppleStoreInstance = () => {
        window.open("https://apple.com", '_blank', "noreferrer");
    }

    export const openGooglePlayInstance = () => {
        window.open("https://apple.com", '_blank', "noreferrer");
    }

    export const openFacebookPage = () => {
        window.open("https://www.facebook.com/profile.php?id=61561334523636", '_blank', "noreferrer");
    }

    export const openInstagramPage = () => {
        window.open("https://www.instagram.com/civitaseurope", '_blank', "noreferrer");
    }

    export const openTikTokPage = () => {
        window.open("https://www.tiktok.com/@civitas.europe", '_blank', "noreferrer");
    }
}

export default ActionsHandler;
